import React, { useState } from 'react';
import styles from './App.module.css';
import leftArrowImage from './assets/leftarrow.png';
import { GridItem } from './components/gridItem';
import { levels, calculateImc, Level } from './helpers/imc';

const App = () => {
    const [heightField, setHeightField] = useState('');
    const [weightField, setWeightField] = useState('');
    const [gender, setGender] = useState('male');
    const [toShow, setToShow] = useState(null);
    const [errorMessage, setErrorMessage] = useState('');
    const [successMessage, setSuccessMessage] = useState('');

    const getIMCInfo = (imc) => {
        let info = {};
    
        if (imc < 18.5) {
            info = {
                level: 'Abaixo do peso',
                message: 'Você está abaixo do peso ideal. Tente ganhar um pouco de peso de forma saudável.',
                lifestyle: 'Considere aumentar sua ingestão calórica com alimentos ricos em nutrientes e fazer exercícios físicos regularmente.'
            };
        } else if (imc < 24.9) {
            info = {
                level: 'Peso normal',
                message: 'Seu peso está dentro da faixa saudável. Continue com um estilo de vida saudável.',
                lifestyle: 'Continue mantendo uma dieta balanceada e praticando exercícios físicos regularmente para manter sua saúde.'
            };
        } else if (imc < 29.9) {
            info = {
                level: 'Sobrepeso',
                message: 'Você está com sobrepeso. É importante começar a adotar hábitos saudáveis para reduzir o peso.',
                lifestyle: 'Reduza o consumo de calorias e aumente a prática de atividades físicas. Consulte um nutricionista para um plano alimentar personalizado.'
            };
        } else {
            info = {
                level: 'Obesidade',
                message: 'Você está em um nível de obesidade. É essencial fazer mudanças no estilo de vida para melhorar sua saúde.',
                lifestyle: 'Procure orientação médica e siga um plano de dieta e exercícios personalizado para perder peso de forma saudável.'
            };
        }
    
        return info;
    };

    const handleCalculateImcButton = () => {
        if (heightField && weightField) {
            const height = parseFloat(heightField);
            const weight = parseFloat(weightField);
    
            if (height > 0 && weight > 20) {
                const imc = calculateImc(height, weight);
                const imcInfo = getIMCInfo(imc);
                setToShow(imcInfo);
                setErrorMessage('');
                setSuccessMessage('Cálculo de IMC realizado com sucesso!');
            } else {
                setErrorMessage('Por favor, insira valores válidos para altura e peso.');
                setSuccessMessage('');
            }
        } else {
            setErrorMessage('Digite todos os campos!');
            setSuccessMessage('');
        }
    };

    const handleBackButton = () => {
        setToShow(null);
        setSuccessMessage('');
        setErrorMessage('');
    };

    return (
        <div className={styles.main}>
            <div className={styles.container}>
                <div className={styles.leftSide}>
                    <h1>Calculadora de IMC</h1>
                    {errorMessage && <div className={styles.errorMessage}>{errorMessage}</div>}
                    {successMessage && <div className={styles.successMessage}>{successMessage}</div>}
                    <input
                        type="number"
                        placeholder="Altura (m)"
                        value={heightField}
                        onChange={e => setHeightField(e.target.value)}
                        disabled={!!toShow}
                    />
                    <input
                        type="number"
                        placeholder="Peso (kg)"
                        value={weightField}
                        onChange={e => setWeightField(e.target.value)}
                        disabled={!!toShow}
                    />
                    <select
                        className={styles.select}
                        value={gender}
                        onChange={e => setGender(e.target.value)}
                        disabled={!!toShow}
                    >
                        <option value="male">Masculino</option>
                        <option value="female">Feminino</option>
                    </select>
                    <button onClick={handleCalculateImcButton} disabled={!!toShow}>Calcular IMC</button>
                </div>
                <div className={styles.rightSide}>
                    {!toShow &&
                        <div className={styles.grid}>
                            {levels.map((item, key) => (
                                <GridItem key={key} item={item} />
                            ))}
                        </div>
                    }
                    {toShow &&
                        <div className={styles.rightBig}>
                            <div className={styles.rightArrow} onClick={handleBackButton}>
                                <img src={leftArrowImage} alt="" width={25} />
                            </div>
                            <GridItem item={toShow} />
                        </div>
                    }
                </div>
            </div>
        </div>
    );
};

export default App;
